u_int16_t R(vector<uint64_t> x, vector<uint64_t> z)
{
    vector<uint64_t> tmp(x.size());
    if(x.size() != z.size())
    {
        std::cout<<"prblem\n\n";
    }
    for(size_t i = 0; i < x.size(); ++i)
    {
        tmp[i] = x[i] ^ z[i];
    }

    u_int16_t R = 0;
    for (int k = 0; k < tmp.size(); ++k)
    {
        for (int i = 0; i < 64; i += 8)
        {
            R += wt8[(tmp[k] >> i) & (255)];
        }
    }
    return R;
}

u_int16_t R1(vector<uint64_t> x, vector<uint64_t> z)
{
    vector<uint64_t> tmp(x.size());
    if(x.size() != z.size())
    {
        std::cout<<"prblem\n\n";
    }
    for(size_t i = 0; i < x.size(); ++i)
    {
        tmp[i] = x[i] ^ z[i];
    }

    u_int16_t R = 0;
    for (int k = 0; k < tmp.size(); ++k)
    {
        for (int i = int(log2(tmp[k])); i >= 0; --i)
        {
            R += (tmp[k] >> i) & 1;
        }
    }
    return R;
}

u_int16_t R2(vector<uint64_t> x, vector<uint64_t> z, vector<int>& wt)
{
    vector<uint64_t> tmp(x.size());

    for(size_t i = 0; i < x.size(); ++i)
    {
        tmp[i] = x[i] ^ z[i];
    }

    u_int16_t R = 0;
    for (int k = 0; k < tmp.size(); ++k)
    {
        for (int i = 0; i < 64; i += 16)
        {
            R += wt[(tmp[k] >> i) & (65535)];
        }
    }
    return R;
}




void takeN(vector<u_int64_t> &z, int N)
{
    std::string s = "";
    std::cout<<s<<'\n';
   // std::reverse(s.begin(),s.end());
    u_int64_t tmp = 0;
    for(int i = 0; i < N; ++i)
    {
        if(i % 64 == 0 && i != 0)
        {
            z.push_back(tmp);
            tmp = 0;
        }

        if(s[i] == '1')
        {
            tmp ^= ((u_int64_t)1 << (63 - i%64));
        }

    }
    if(z.size() != ceil(double(N)/double(64)))
        z.push_back(tmp);
}
