void buildX(vector<u_int64_t> &x, const int& N, u_int64_t u)
{
    u_int64_t tmp = 0;
    u_int64_t x0 = 0;
    //std::cout<<"x0:\n";
    L1(u, x0);
    tmp ^= x0 << 63 ;
    //std::cout<<x0;
    for(int i = 1; i < N; ++i)
    {
        if(i % 64 == 0 )
        {
            //std::cout<<" ";
            x.push_back(tmp);
            tmp=0;
        }
        L1(u, x0);
        tmp ^= x0 << (63 - i%64);
        //std::cout<<x0;
    }
    //std::cout<<"\n";
    if(x.size() != ceil(double(N)/double(64)))
        x.push_back(tmp);

}

void buildY(vector<u_int64_t> &x, const int& N, u_int64_t u)
{
    u_int64_t tmp = 0;
    u_int64_t x0 = 0;
    //std::cout<<"x0:\n";
    L2(u, x0);
    tmp ^= x0 << 63 ;
    //std::cout<<x0;
    for(int i = 1; i < N; ++i)
    {
        if(i % 64 == 0 )
        {
            //std::cout<<" ";
            x.push_back(tmp);
            tmp=0;
        }
        L2(u, x0);
        tmp ^= x0 << (63 - i%64);
        //std::cout<<x0;
    }
    //std::cout<<"\n";
    if(x.size() != ceil(double(N)/double(64)))
        x.push_back(tmp);

}

void buildWt(std::vector<int>& wt)
{
    for(int i = 0; i < 65536; ++i)
    {
        int m =0;
        for(int j = 0; j < 16; ++j)
        {
            m += ((i>>j)&1);
        }
        wt.push_back(m);
    }
}
const std::string checkZ ="";

bool checkL1L2(uint64_t cL1,  uint64_t cL2, uint64_t cL3)
{
    for(int k = 0; k < 2048; ++k)
    {
        uint64_t x0 = 0, y0 = 0,s0 = 0;
        L1(cL1, x0);
        L2(cL2, y0);
        L3(cL3, s0);
        uint64_t z = F(x0,y0,s0);
        uint64_t tmpZ = 0;

        if((checkZ[k] == '1') )
        {
            tmpZ = 1;
        }

        if(tmpZ != z)
        {
            return 0;
        }
    }
    //std::cout<<"\n L1: "<< cL1<<" L3:"<< cL2<<" L3:"<<cL3<<"\n";

    return 1;
}


void findL3(const vector<uint64_t>& cL1, const vector<uint64_t>& cL2)
{
    uint64_t t3 = (uint64_t)1<<27;

    #pragma omp parallel for
    for(uint64_t i = 0; i < t3; ++i)
    {
        for(auto k1 : cL1)
        {
            for(auto k2: cL2)
            {
                if (checkL1L2(k1,k2,i) == 1)
                {
                    std::cout<<"\n"<<k1<<" "<<k2<<" "<<i<<"\n";
                }
            }
        }

        if(i % (uint64_t)100000000 == 0)
        {
            std::cout<<"\n"<<i<<"\n";
        }
    }
    return ;
}



